import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./homepage.css";
import { motion, AnimatePresence } from "framer-motion";

export const HomePage = () => {
  const [showOverlay, setShowOverlay] = useState(false);

  const wordVariants = {
    hidden: {
      opacity: 0,
      y: 50,
    },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 1,
      },
    },
  };

  const overlayVariants = {
    initial: {
      opacity: 0,
      y: "100%",
    },
    animate: {
      opacity: 0.8,
      y: 0,
      transition: {
        duration: 1,
      },
    },
    exit: {
      opacity: 0,
      y: "100%",
      transition: {
        duration: 1,
      },
    },
  };

  const handleNavbarClick = () => {
    setShowOverlay(true);
    // Add additional logic here if needed
  };

  return (
    <div className="container">
      <div className="home-content">
        <div className="main-content">
          <div className="content-wrapper">
            <div
              style={{
                fontFamily: "monospace",
                fontSize: "200px",
                color: "#000000",
                textAlign: "left",
              }}
            >
              <motion.div
                initial="hidden"
                animate="visible"
                variants={wordVariants}
                style={{ display: "inline-block" }}
              >
                <motion.span variants={wordVariants}>JSM</motion.span>
              </motion.div>
              <br />
              <motion.div
                initial="hidden"
                animate="visible"
                variants={wordVariants}
                transition={{ delay: 0.5 }}
                style={{ display: "inline-block" }}
              >
                <motion.span variants={wordVariants}>The</motion.span>
              </motion.div>
              <br />
              <motion.div
                initial="hidden"
                animate="visible"
                variants={wordVariants}
                transition={{ delay: 1 }}
                style={{ display: "inline-block" }}
              >
                <motion.span variants={wordVariants}>Barber</motion.span>
              </motion.div>
            </div>
            <nav>
              <ul>
                <li onClick={handleNavbarClick}>
                  <Link to="/about">About</Link>
                </li>
                <li onClick={handleNavbarClick}>
                  <Link to="/services">Services</Link>
                </li>
                <li onClick={handleNavbarClick}>
                  <Link to="/contact">Contact</Link>
                </li>
              </ul>
            </nav>
          </div>
        </div>
      </div>
      <AnimatePresence>
        {showOverlay && (
          <motion.div
            className="overlay"
            variants={overlayVariants}
            initial="initial"
            animate="animate"
            exit="exit"
          />
        )}
      </AnimatePresence>
    </div>
  );
};
